import React from 'react';
import { useAnimeState } from '../ducks/anime/selectors';

const Detail = (): JSX.Element => {
	const animeDetail = useAnimeState().anime;

	console.log(animeDetail);

	return (
		<>
			<div>{animeDetail}</div>
		</>
	);
};

export default Detail;
